import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import './CompanyDashboard.css';

function CompanyDashboard() {
  const navigate = useNavigate();

  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <h1>Welcome back, Example Corp!</h1>
      </header>
      <div className="dashboard-body">
        <nav className="dashboard-sidebar">
          <ul>
            <li><Link to="/available-internships">Available Internships</Link></li>
            <li><Link to="/notifications">Notification Center</Link></li>
            <li><Link to="/internship-postings">Internship Postings</Link></li>
            <li><Link to="/company-profile">Company Profile</Link></li>
          </ul>
        </nav>
        <main className="dashboard-main">
          <Routes>
            <Route path="/available-internships" element={<AvailableInternships />} />
            <Route path="/notifications" element={<NotificationCenter />} />
            <Route path="/internship-postings" element={<InternshipPostings />} />
            <Route path="/company-profile" element={<CompanyProfile />} />
          </Routes>
        </main>
      </div>
      <footer className="dashboard-footer">
        <p>&copy; 2025 GUC Internship Portal</p>
      </footer>
    </div>
  );
}

function AvailableInternships() {
  return <div><h2>Available Internships</h2><p>List of internships...</p></div>;
}

function NotificationCenter() {
  return <div><h2>Notification Center</h2><p>Notifications...</p></div>;
}

function InternshipPostings() {
  return (
    <div>
      <h2>Internship Postings</h2>
      <button>My Internship Postings</button>
      <button>All Postings</button>
      <p>Postings content...</p>
    </div>
  );
}

function CompanyProfile() {
  return (
    <div>
      <h2>Company Profile</h2>
      <p>Company details, statistics, and more...</p>
    </div>
  );
}

export default CompanyDashboard;
